import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

import NavBar from './NavBar/NavBar'
import Home from './Home/Home'
import './App.sass'



class App extends React.Component {
    render()
    {
        return (
        <Router>
        <div className="container-fluid">
            <NavBar></NavBar>
            <Switch>
                <Route path="/">
                    <Home />
                </Route>
            </Switch>
            </div>
            </Router>
            );


    }
}

export default App;
